import React from 'react';
import clsx from 'clsx';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText'; 
import HomeIcon from '@material-ui/icons/Home';
import InsertInvitationIcon from '@material-ui/icons/InsertInvitation';
import { useHistory } from 'react-router';
import AppBarMenu from './_components/AppBarMenu';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },   
  drawerHeaderContent: {
    display: 'flex',
    alignItems: 'center', 
    padding: theme.spacing(0, 1),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
    transition: theme.transitions.create('margin', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    marginLeft: -drawerWidth,
    backgroundImage:  `url(${'./images/equipment.jpg'})` ,
    backgroundRepeat: 'no-repeat',
    backgroundSize:'90vw',
    height: '100vh', 
    background: `linear-gradient(to top,  url(${'./images/equipment.jpg'}))`
  },
  contentShift: {
    transition: theme.transitions.create('margin', {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
    marginLeft: 0,
  } 
}));

const Home = () => {
  const classes = useStyles();
  const theme = useTheme();
  const [open, setOpen] = React.useState(true);
  let history = useHistory();


  const getTurnosOnlinePage = () => {
    history.push("/turnosOnline"); 
  };

  const getHomePage = () => {
    history.push("/home"); 
  };
  const handleDrawerOpen = () => {
    setOpen(!open);
  };

  const handleDrawerClose = () => {
    setOpen(!open);
  };

  return (
    <div className={classes.root}>
       <AppBarMenu/>
      <main
        className={clsx(classes.content, {
          [classes.contentShift]: open,
        })}
      >
        <div className={classes.drawerHeaderContent} />

        <Typography variant="h6" paragraph>
          Bienvenidos !
        </Typography>
        <Typography paragraph>
          Trabajamos diariamente para ser la mejor opción odontológica para la comunidad enfocándonos en que la atención a nuestros pacientes sea una experiencia placentera; queremos que el resultado sea una buena sonrisa con todo lo que eso significa: no sólo la estética, sino también felicidad, el sentirse acompañado y contenido, alimentando así una
          fidelización a largo plazo.
      </Typography>
        <Typography paragraph>
          Nuestros recursos humanos son nuestra fuente de crecimiento y atención directa a nuestros pacientes, por ello, brindamos un plan de carrera, desarrollo profesional y constante formación para todos quienes forman parte de la empresa, dentro un cálido ambiente laboral y un buen trato.
          </Typography>
        <Typography paragraph>
          Nos desarrollamos día a día para ser la mejor opción laboral para todos aquellos que busquen la excelencia, el crecimiento personal, económico y profesional. Colaboramos con el crecimiento de nuestros Proveedores.
    </Typography>
        <Typography paragraph>
          Nos comprometemos en mejorar en forma continua los procesos que conforman el Sistema de Gestión de la Calidad y a través de ello convertirnos en el mejor referente de atención odontológica para el paciente, trabajando día a día para cumplir con los expectativas de nuestras partes interesadas.
        </Typography>
      </main>
    </div>
  );
}


export default Home;
